'use strict';
var uploadMaxTime = 0;
var uploadStopped = false;
var upload = function () {
    //thread safe
    if ($('#uploadbutton').attr('disabled') === 'disabled') {
        return;
    }
    $('#uploadbutton').attr('disabled', 'disabled');
    uploadStopped = false;
    startupload();
};

var startupload = function () {
    //prepare
    var data = "";
    var st = new Date();
    $.post('/home/upload', {str:data} ,function (data) {
        if (uploadStopped) {
            return;
        }
        //get time
        var et = new Date();
        var uploadTime = et - st;
        //update max value
        if (uploadTime > uploadMaxTime) {
            uploadMaxTime = uploadTime;
        }
        //get speed
        var speed = 1.0 / uploadTime * 1000;
        var minspeed = 1.0 / uploadMaxTime * 1000;
        //log
        if (speed < $('#speedlagfilter').val()) {
            trig('uploader', speed + 'MB/s');
        }
        //update view
        $('#uploadStatus').html('Speed: ' + speed.toFixed(2) + 'MB/s');
        $('#uploadMax').html('Min: ' + minspeed.toFixed(2) + 'MB/s');

        if (uploadchartData.labels.length > 25) {
            uploadchartData.labels.shift();
            uploadchartData.datasets[0].data.shift();
        }
        uploadchartData.labels.push('');
        uploadchartData.datasets[0].data.push(speed.toFixed(2));
        window.myUploadLine.update();

        setTimeout(startupload, 1000);
    });
};

var stopUpload = function () {
    uploadStopped = true;
    if ($('#uploadbutton').removeAttr('disabled')) {
        return;
    }
}